export class Merchandise{

  constructor(userId, itemName, itemDescription, itemImageSrc) {
    this.userId = userId;
    this.itemName = itemName;
    this.itemDescription = itemDescription;
    this.itemImageSrc = itemImageSrc;
  }

}
